values:
I was sitting here wondering how people ever see other peoples' journals on this.  There are thousands of users, and you never really realize how many people take a look, or anything.  And it's almost impossible to find anybody with the Find Users By Interest link, because it stops letting you see them after so many: For example, try searching for "Godsmack" or "Dancing".  You get nothing! 

So in the spirit of boredom, and being home all day, I propose you do the following;
 
Click on each of your friends' names.  Open them in a new window.  Click each of that friend's friends.  Click each of those friends' friends.  The only secret to doing this is never click on the same name twice, and don't count yourself.  See how many people you can find.  I ran into several dead-ends, but by using Ninhydrin as a starting point, I gave up after writing down 239 names.  If someone else has more patience, tell me the results after you're done.
